import React from 'react';

const Pagination = ({gotoNextPage, gotoPrevPage}) => {
    const [state, useState] = React.useState([gotoPrevPage, gotoNextPage])
    return(
        <div>
            <button onClick={gotoPrevPage} disabled={state[0] ? gotoPrevPage : true}>
                Previous Page
            </button>
            <button onClick={gotoNextPage} disabled={state[1] ? gotoNextPage : true}>
                Next Page
            </button>
        </div>
    )
}

export default Pagination;
